style.css:
@-moz-document domain("basecamp.com")
{
.messages-table__subject,
.formatted_content,
.card__title,
.card__description,
.messages-table__overflow,
.activity-item,
.card__description
.project-header__details,
.chat__room,
.project-header__description,
.recording-breadcrumb__title,
.checkbox,
.card h1,
.flush--top,
.push_quarter--ends,
.card-questionnaire__title {
    font-family: IRANSansss, tahoma;
}

h1, h2, h3 {
    line-height: 1.5;
}
.btn--tiny-icon{
 overflow: hidden;   
}
.messages-table__overflow,
.activity-item__excerpt,
.chat-line__body,
.card__description {
    font-size: 11px;
}

.chat-line__body{
   font-size: 12px;
}

blockquote {
    border-right: 3px solid #000;
    border-left: none;
    margin: 0;
    padding: 0 1em 0 0;
    text-align: right;
    direction: rtl;

}

.chat-line__bubble{
    direction: rtl;
    text-align: right;
}

.thread-entry{
        padding: 1.2em 1.2em 1.3em;
}

.chat-line__body blockquote,
.chat__footer blockquote{
    border: none;
    margin: 0;
    padding: 0;
}

.formatted_content h1,
.activity-item__excerpt,
.card__description {
    line-height: 1.8em;
}
.message__subject,
.input--title,
.formatted_content {
    direction: rtl;
    text-align: right;
    line-height: 1.8;
}

.message__subject,
.input--title,
.project-header__name--overview {
    font-family: IRANSansss;
    font-size: 24px;
    font-weight: bold;
}

.formatted_content h1 {
    font-weight: normal;
}

.card__title {
    line-height: 1.4em;
}

.messages-table__overflow {
    line-height: 1.5;
}

.card__description {
    padding-top: 5px;
}

.project-header__details {
    line-height: 3em;
}

.formatted_content,
.project-header__description  {
    font-size: 14px;
}

.checkbox,
.recording-breadcrumb__title,
.messages-table__subject {
    font-size: 13px;
}

.todolist-group__header {
    margin-top: 5px;
}

.messages-table--for-card .messages-table__overflow {
    max-height: 2.9em;
}
.card__link .formatted_content * {
    padding: 0;
    margin: 0;
    font-size: 11px;
}

.card h1 {
    font-size: 15px !important;
}

.flush--top {
    font-size: 17px;
}

.flush--top.metadata {
    font-size: 11px;
    color: #888;
}

.card-questionnaire__title {
    font-size: 13px;
}

pre {
    direction: ltr;
    text-align: left;
    font-family: monospace, monaco;
}

.todo__comment {
    line-height: 1.5;
}
.checkbox__content{
    word-break: break-word;
}
.checkbox__content a:first-child {
    direction: rtl;
    display: inline-block;
}

.todos-form__title {
    text-align: left;
    direction: rtl;
}

.todos-form__title::placeholder {
    direction: ltr;
}

.txt--truncate {
    font-size: 14px
}

.todolist-group ul {
    margin-left: 25px;
}

.todolist-group .todolist__title {
    font-size: 15px;
}

.flush--top.metadata,
.push_quarter--ends {
    color: #009688;
}

.inbox-forward .message__subject,
.inbox-forward .input--title,
.inbox-forward .formatted_content {
    direction: ltr;
    text-align: left;
}











@font-face {
    font-family: 'IRANSansss';
    src: url(data:application/font-woff2;charset=utf-8;base64,) format('woff2'),
    url(data:application/font-woff;charset=utf-8;base64,) format('woff'),
    url('IRANSans.ttf') format('truetype'),
    url('IRANSans.svg#IRANSans') format('svg');
    font-weight: normal;
    font-style: normal;
}
}
